import Firstpage from './Firstpage'
import Postview from './Postview';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from 'react-router-dom';

function App() {
  return (
    <Router>
      <Firstpage />
      <div>
        <Link to='Enter'>Enter</Link>
      </div>
      <Routes>
        <Route path='/Enter' element={<Postview />}></Route>
      </Routes>

    </Router>




  )
};

export default App;
